module.exports = {
	root: true,
	parserOptions: {
		project: './tsconfig.json',
		tsconfigRootDir: __dirname,
	},
	extends: ['lisk-base/ts'],
	rules: {
		'@typescript-eslint/member-ordering': 'off',
		'@typescript-eslint/no-unsafe-argument': ['warn'],
	},
};

module.exports = {
	extends: ['lisk-base/ts-jest'],
	parserOptions: {
		project: './tsconfig.json',
		tsconfigRootDir: __dirname,
	},
	rules: {
		'@typescript-eslint/member-ordering': 'off',
		'@typescript-eslint/no-unsafe-argument': 'off',
	},
};

{
	"*.js": ["prettier --write"],
	"*.ts": ["prettier --write", "eslint"],
	"*.{json,md}": ["prettier --write"]
}

{
	"tasksRunnerOptions": {
		"default": {
			"runner": "nx/tasks-runners/default",
			"options": {
				"cacheableOperations": [
					"format",
					"lint",
					"lint:fix",
					"build",
					"test",
					"test:coverage",
					"test:ci"
				]
			}
		}
	},
	"targetDefaults": {
		"lint": {
			"dependsOn": ["^lint"]
		},
		"lint:fix": {
			"dependsOn": ["^lint:fix"]
		},
		"build": {
			"dependsOn": ["^build"],
			"outputs": ["{projectRoot}/dist-node"]
		},
		"test": {
			"dependsOn": ["^test"]
		},
		"test:coverage": {
			"dependsOn": ["^test:coverage"]
		},
		"test:ci": {
			"dependsOn": ["^test:ci"]
		},
		"test:unit": {
			"dependsOn": ["^test:unit"]
		}
	},
	"defaultBase": "development"
}
